import React, { Component } from "react";
import TimerForm from "./TimerForm";
import Timer from "./Timer";

class Container extends Component {
  render() {
    return (
      <div>
        <div>{this.props.onFormOpen ? <Timer /> : <TimerForm />}</div>
      </div>
    );
  }
}
export default Container;
